import React from 'react';
import logo from './logo.svg';
import './App.css';
import MainPage from './pages/MainPage'
import Header from './components/Header'
import PageSignInSignOut from './pages/P'

const App = () => {
  return (
    <div className="App">
      <Header />
      <PageSignInSignOut/>
      <MainPage />
    </div>
  );
};

export default App;
